import Products from "../components/Products";
import { DataContext } from "../store/DataStore";

export default function User({user}){

   const {products, fetchData} = useContext(DataContext);
    return(
      <Products
      user={user}
      products={products}
      fetchData={fetchData}
    />
    );
}
